import React from 'react';
import Link from 'next/link';

const NavLink = ({ href, children }) => {
  return (
    <Link href='/sobre'>
      <a>Sobre</a>
    </Link>
  )
}

const NavBar = () => {
  return (
    <div className='bg-gray-500 py-4'>
      <NavLink href='/sobre'>Sobre</NavLink>
      <Link href='/cadastro'>
        <a>Cadastro</a>
      </Link>
      <Link href='/entrar'>
        <a>Entrar</a>
      </Link>
    </div>
  )
}

export default NavBar;
